import React,{useState,useEffect} from "react";


function App() {
  const [persons,setPersons]= useState([])

  useEffect(() => {
      fetch("https://gorest.co.in/public/v1/users", {
          headers: {
              "Content-Type": "application/json",
              "Authorization": "Bearer bc1e0809f9bb5ce03125ea49290ec9c8acc225870ebd21e484217e79b88800db"
          } })
      .then(resp => resp.json())
      .then(data => setPersons(data))

  }, []);
  return (
    <table>
    <thead>
            <tr>
              <th>Customer ID</th>
              <th>Name</th>
              <th>Email</th>
              <th>Phone</th>
              <th>Modify Customer</th> 
            </tr>
          </thead>
          <tbody>
            {/* iterate through the customers array and render a unique Customer component for each customer object in the array */}
        {persons.map(person => 
                <tr key={person.id}>
                <td>{person.id}</td>
                <td>{person.name}</td>
                <td>{person.email}</td>
                <td>{person.gender}</td>
                <td>{person.status}</td>
                <td><button>Edit</button></td>
            </tr>
              )}
          </tbody>
        </table>
  );
}

export default App;
